package com.john.leetcode.Dec2024.q200_299;

import com.john.utils.CollectionCreator;
import com.john.utils.ListAssert;
import java.util.List;
import org.junit.Test;

public class Question212Test {
    private final Question212 classUnderTest = new Question212();

    @Test
    public void testExample1() {
        char[][] board = CollectionCreator.create2DArrayChar("[[o,a,a,n],[e,t,a,e],[i,h,k,r],[i,f,l,v]]");
        String[] words = CollectionCreator.createArrayString("[oathDELpeaDELeatDELrain]");
        List<String> expected = CollectionCreator.createListString("[eatDELoath]");
        ListAssert.assertSortedListStringEquals(expected, classUnderTest.findWords(board, words));
    }

    @Test
    public void testExample2() {
        char[][] board = CollectionCreator.create2DArrayChar("[[a,b],[c,d]]");
        String[] words = CollectionCreator.createArrayString("[abcb]");
        List<String> expected = CollectionCreator.createListString("[]");
        ListAssert.assertSortedListStringEquals(expected, classUnderTest.findWords(board, words));
    }

    @Test
    public void testExample3() {
        char[][] board = CollectionCreator.create2DArrayChar("[[m,b,c,d,e,f,g,h,i,j,k,l],[n,a,a,a,a,a,a,a,a,a,a,a],[o,a,a,a,a,a,a,a,a,a,a,a],[p,a,a,a,a,a,a,a,a,a,a,a],[q,a,a,a,a,a,a,a,a,a,a,a],[r,a,a,a,a,a,a,a,a,a,a,a],[s,a,a,a,a,a,a,a,a,a,a,a],[t,a,a,a,a,a,a,a,a,a,a,a],[u,a,a,a,a,a,a,a,a,a,a,a],[v,a,a,a,a,a,a,a,a,a,a,a],[w,a,a,a,a,a,a,a,a,a,a,a],[x,y,z,a,a,a,a,a,a,a,a,a]]");
        String[] words = CollectionCreator.createArrayString("[]");
        List<String> expected = CollectionCreator.createListString("[]");
        ListAssert.assertSortedListStringEquals(expected, classUnderTest.findWords(board, words));
    }
}
